import React, { useRef, useState } from 'react'
import "./navbar.css"

const Navbar = () => {
  const[menu,setMenu]=useState(false);

  const toggleMenu=()=>{
    setMenu
  }
  return (
    <header className="header" onClick={setMenu(true)}>
      <a href="/" className='logo'>Logo</a>

      <nav className='navbar'>
        <a href="/">Home</a>
        <a href="/">About</a>
        <a href="/">Portfolio</a>
        <a href="/">Service</a>
        <a href="/">Contact</a>
      </nav>

      <div className="bars" onClick={setMenu(true)}>
       { menu==true?<i class="fa-solid fa-bars"></i>:<i class="fa-solid fa-x"></i>}
      </div>
    </header>
  )
}

export default Navbar
